import styled from 'styled-components';

export const Container = styled.div`
    div#headerbtn {
        position: absolute;
        width: 100%;
        top: 5%;
        left: 10%;
    }

    Button {
        margin-left: 15%;
    }

    ProjectLine {
        top: 20%;
        left:10%;
    }
`;
